import React, { useState } from "react";


const SignUp=()=>{
    const [avatar, setAvatar]=useState('hers is images')
    console.log(avatar);

    return(
        <div>
            <h1>hello this is SignUp page</h1>
            <form>
                <div className="email">
                    {/* <Label>Email</Label> */}
                    <input type="Email" placeholder="inter your email"/>
                </div>
                <div className="password">
                    {/* <lable>Password</lable> */}
                    <input type="password" placeholder="inter your password"/>
                </div>
                <div className="repassword">
                    {/* <lable>Password</lable> */}
                    <input type="password" placeholder="repeat your password"/>
                </div>
                <div className="avatar">
                    {/* <lable>avatar</lable> */}
                    <input type="file" placeholder="avatar"/>
                </div>
                <div className="submit">
                    {/* <lable>avatar</lable> */}
                    <input type="submit" title="Submit" onChange={setAvatar( event.target.files[0]) }/>
                </div>
                
            </form>
            <div>
                <img src={avatar&&avatar.default} alt={avatar}/>
            </div>

        </div>
    )
}
export default SignUp
